using System;
using System.Net;
using Microsoft.Exchange.WebServices.Data;

public static class Snippet
{
	public static System.String OutlookDelete(System.String myuid, System.String myURL, System.Boolean myDefaultUser, System.String myUser, System.String myPassword)
	{
		ServicePointManager.SecurityProtocol = SecurityProtocolType.Tls12;
		ExchangeService service = new ExchangeService(ExchangeVersion.Exchange2007_SP1);
		service.Url = new Uri(myURL);		
		if (myDefaultUser==true) 
		{ 
			service.UseDefaultCredentials = true; 
		} 
		 else
		{ 
			service.Credentials = new WebCredentials(myUser,myPassword ); 
		}
		try
		{
		 Appointment appointment = Appointment.Bind(service, new ItemId(myuid));
		 //appointment.Delete(DeleteMode.MoveToDeletedItems);
		 appointment.Delete(DeleteMode.HardDelete);
		}
		catch  (Exception e)
		{
		 return e.Message;
		}
		return "";
	}

}

using System;
using System.Net;
using Microsoft.Exchange.WebServices.Data;

public static class Snippet
{
	public static System.String OutlookTermin(System.Boolean myDefaultUser, System.String myUser, System.String myPassword, System.String myURL, System.String myRecipient, System.String myOutlookID, System.String myDateTime, System.String mySubject, System.String myBody, System.String myAction, System.Double myDuration, System.String myCategorie, System.String myLocation, System.Boolean myReminder, System.Boolean myHTMLBody, System.Boolean myAllDay, System.Boolean myUseToken, System.String myToken)
	{
		ServicePointManager.SecurityProtocol = SecurityProtocolType.Tls12;
		ExchangeService service;
		try 
		 { 			
		   service = new ExchangeService(ExchangeVersion.Exchange2010_SP2);
		 }
		catch (Exception ex)
		 {
			return ex.Message;
		 }


		DateTime myDate = new DateTime();

		service.Url = new Uri(myURL);		

		if (myDefaultUser==true && myUseToken==false) 
		{ 
			service.UseDefaultCredentials = true; 
		} 
		 else
		{ 
			if (myUseToken==true)
			{
				service.ImpersonatedUserId = new ImpersonatedUserId(ConnectingIdType.SmtpAddress,myUser);
				service.Credentials = new OAuthCredentials(myToken);
			}
			else
			{
				service.Credentials = new WebCredentials(myUser,myPassword ); 
			}			
		}

		myDate = DateTime.ParseExact(myDateTime,"dd.MM.yyyy HHmmss", null);

		Mailbox myMailbox = new Mailbox(myRecipient);
		FolderId myFolder = new FolderId(WellKnownFolderName.Calendar, myMailbox);

		Appointment myapt = new Appointment(service);

		myapt.Subject = mySubject;
		myapt.Body = myBody;
		if (myHTMLBody==true) 
		{
		    myapt.Body.BodyType = BodyType.HTML;
		} 
		else
		{ 
			myapt.Body.BodyType = BodyType.Text;
		}
		myapt.Start = myDate;		
		if (myAllDay==true)
		{
			myapt.IsAllDayEvent = true;
			myapt.End = myDate;
		}
		else
		{
			myapt.End = myDate.AddMinutes(myDuration);
		}

		myapt.Categories.Add(myCategorie);
		myapt.Location = myLocation;
		myapt.Importance = Importance.Normal;

		if (myReminder==true)
		{
			myapt.IsReminderSet = true;
		}
		else
		{
			myapt.IsReminderSet = false;
		};
		myapt.Save(myFolder,SendInvitationsMode.SendToNone);
		myapt.Load();
		return myapt.Id.UniqueId;
	}

}

using System;
using System.Net;
using Microsoft.Exchange.WebServices.Data;

public static class Snippet
{
	public static System.String OutlookUpdate(System.String myURL, System.Boolean myDefaultUser, System.String myUser, System.String myPassword, System.String myuid, System.String myDateTime, System.Double myDuration, System.String myBody, System.String mySubject, System.String myLocation, System.Boolean myAllDay, System.Boolean myUseToken, System.String myToken)
	{
		ServicePointManager.SecurityProtocol = SecurityProtocolType.Tls12;
		ExchangeService service = new ExchangeService(ExchangeVersion.Exchange2010_SP2,TimeZoneInfo.Local);
		service.Url = new Uri(myURL);		
if (myDefaultUser==true && myUseToken==false) 
		{ 
			service.UseDefaultCredentials = true; 
		} 
		 else
		{ 
			if (myUseToken==true)
			{
				service.ImpersonatedUserId = new ImpersonatedUserId(ConnectingIdType.SmtpAddress,myUser);
				service.Credentials = new OAuthCredentials(myToken);
			}
			else
			{
				service.Credentials = new WebCredentials(myUser,myPassword ); 
			}			
		}
		DateTime myDate = new DateTime();
		Appointment myapt = Appointment.Bind(service, new ItemId(myuid), new PropertySet(AppointmentSchema.Start, 
				AppointmentSchema.End,  AppointmentSchema.StartTimeZone, AppointmentSchema.Body, AppointmentSchema.Subject, AppointmentSchema.Location ));

		try
		{
        myDate = DateTime.ParseExact(myDateTime,"dd.MM.yyyy HHmmss", null);

		myapt.StartTimeZone = TimeZoneInfo.Local;
		myapt.Start = myDate;		
		if (myAllDay==true)
		{
			myapt.IsAllDayEvent=true;
			myapt.End = myDate.AddDays(1);
		}
		else
		{
			myapt.IsAllDayEvent=false;
			myapt.End = myDate.AddMinutes(myDuration);
		}		
		}
		catch  (Exception e)
		{
		 return "Ex 1 "+e.Message;
		}
		try
		{
		if (myBody != "" && myBody != null) 
			{
				myapt.Body.BodyType = BodyType.Text; 
				myapt.Body.Text = myBody.Trim();
			}
		if (mySubject != "" && mySubject != null) 
			{
				myapt.Subject = mySubject.Trim();
			}
		}
		catch  (Exception e)
		{
		 return "Ex 2 "+e.Message;
		}
		try
		{
			if (myLocation != "" && myLocation != null)
			{myapt.Location = myLocation;}

		myapt.Update(ConflictResolutionMode.AlwaysOverwrite, SendInvitationsOrCancellationsMode.SendToNone);

		}
		catch  (Exception e)
		{
		 return "Ex 3 "+e.Message;
		}
		return "OK";
	}
}

using System;
using System.Net;
using Microsoft.Exchange.WebServices.Data;

public static class Snippet
{
	public static System.String create_task(System.Boolean myDefaultUser, System.String myUser, System.String myPassword, System.String myURL, System.String myRecipient, System.String myEntryID, System.String myDateTime, System.String mySubject, System.String myBody, System.Boolean myUseToken, System.String myToken)
	{
		ServicePointManager.SecurityProtocol = SecurityProtocolType.Tls12;
		ExchangeService service;
		try 
		 { 			
		   service = new ExchangeService(ExchangeVersion.Exchange2010_SP2);
		 }
		catch (Exception ex)
		 {
			return ex.Message;
		 }
		DateTime myDate = new DateTime();
		service.Url = new Uri (myURL);
		if (myDefaultUser==true && myUseToken==false) 
		{ 
			service.UseDefaultCredentials = true; 
		} 
		 else
		{ 
			if (myUseToken==true)
			{
				service.ImpersonatedUserId = new ImpersonatedUserId(ConnectingIdType.SmtpAddress,myUser);
				service.Credentials = new OAuthCredentials(myToken);
			}
			else
			{
				service.Credentials = new WebCredentials(myUser,myPassword ); 
			}			
		}		
		myDate = DateTime.ParseExact(myDateTime,"dd.MM.yyyy HHmmss",null);
		service.ImpersonatedUserId = new ImpersonatedUserId(ConnectingIdType.SmtpAddress, myRecipient);
		Mailbox myMailbox = new Mailbox(myRecipient);
		FolderId myFolder = new FolderId(WellKnownFolderName.Tasks, myMailbox);
		TasksFolder myTasks = TasksFolder.Bind(service, myFolder);

		Task mytask = new Task (service);
		mytask.Subject = mySubject;
		mytask.Body = myBody;
		mytask.ReminderDueBy = myDate;
		mytask.ReminderMinutesBeforeStart = 120;
		mytask.IsReminderSet = true;		
		mytask.DueDate = myDate;
		mytask.Save(myFolder);
		mytask.Load();
		return mytask.Id.UniqueId;
	}

}
